const Word = (props) => {
    const base = props.base
    console.log(base);
    const word = props.word
    const fetchWordDescription = props.fetchWordDescription
    return <span onClick={() => 
        fetchWordDescription(
            word
            .replaceAll(".","")
            .replaceAll(",","")
            .replaceAll("(","")
            .replaceAll(")","")
            .replaceAll("-","")
        )}>{word} </span>
}
export default Word;
